 }

 async request(endpoint, options = {}) {
 const url = `${this.baseUrl}${endpoint}`;
 const config = {
 headers: {
 'Content-Type': 'application/json',
 'Accept': 'application/json',
 'X-UserToken': window.g_ck
 },
 ...options
 };

 try {
